"accidentExcessModalText" : "AER New Zealand;
Hertz rates in New Zealand include Loss Damage Waiver (LDW), which provides coverage for accident damage to the Hertz vehicle, subject to certain exclusions. In the event of accident damage covered by LDW (other than damage resulting from fire, theft, conversion or attempted theft or conversion of the Hertz vehicle), an Accident Damages Excess (ADE) will apply. This is the amount you contribute towards the loss or damage to the rental vehicle.
When you purchase AER, which is not insurance, your liability for the ADE is waived. As of January 1, 2006, the charge for AER is $NZ22.00 per day plus GST (for Vehicle Groups B, C, D, E and F) and NZ$25.00 per day plus GST (for Vehicle Groups H, J, K, L and M)."

"accidentExcessModalText" : "Réduction excédentaire pour accident (AER) en Nouvelle-Zélande;
Les tarifs de Hertz en Nouvelle-Zélande comprennent une exonération de dommages matériels (EDM) qui fournit une couverture pour les dommages causés par un accident au véhicule de Hertz, sous réserve de certaines exclusions. En cas de dommages causés par un accident qui sont couverts par l'exonération de dommages matériels (autres que les dommages découlant d'un incendie, d'un vol, d'un détournement ou d'une tentative de vol ou de détournement du véhicule de Hertz), un excédent pour dommages par accident s'appliquera. Il s'agit du montant de votre contribution à la perte ou aux dommages du véhicule de location.
Si vous achetez la réduction excédentaire pour accident, qui n'est pas une assurance, votre responsabilité pour l'excédent pour dommages dus à un accident est levée. Depuis le 1er janvier 2006, les frais pour la réduction excédentaire pour accident sont de 22,00 $ NZD par jour plus la TPS (pour les véhicules des groupes B, C, D, E et F) et de 25,00 $ NZD par jour plus la TPS (pour les véhicules des groupes H, J, K, L et M)."

"privacyPolicyDetailDescriptionText" : "Portée
La présente politique concerne les renseignements que nous recueillons auprès de vous qui permettent de vous identifier personnellement, dans le cadre de nos activités de location de véhicules et de nos autres activités associées.
La présente politique ne concerne pas les renseignements qui ne permettent pas de vous identifier personnellement.
Données recueillies et méthodes de collecte
Nos annonceurs, nos entreprises sous licence, nos partenaires commerciaux, nos commanditaires de programmes de rabais et nous pouvons recueillir des renseignements auprès de vous de multiples façons, notamment au moyen d'appels téléphoniques, de communications avec le service à la clientèle, d'applications mobiles, de sites Web et d'autres sources. Nous recueillons des renseignements auprès des clients lors du processus de réservation et des transactions de location, comme le nom, l'adresse et les renseignements sur la carte de paiement. Nous recueillons des données personnelles pour vous fournir des services de location exceptionnels, notamment :
votre nom, votre numéro de téléphone, votre adresse, votre date de naissance;
votre numéro de permis de conduire ou d'autres formes d'identification;
informations sur votre employeur (numéro, adresse, coordonnées);
votre solvabilité ou d'autres renseignements sur vos antécédents.Buts du traitement de ces données
Les renseignements que vous fournissez seront utilisés pour vous fournir les services dont vous faites la demande. Nous utiliserons les coordonnées que vous indiquez pour communiquer avec vous. Nous utilisons des « témoins » et d'autres outils électroniques pour recueillir des renseignements statistiques sur votre utilisation de nos sites Web. Ces renseignements sont utilisés à des fins de recherche et pour d'autres raisons, en général afin de mieux aider nos clients en révélant de quelle façon nous pouvons améliorer nos sites Web. Nous utilisons les renseignements personnels à des fins d'analyse interne. Divulgations à des tiers Nous pouvons communiquer vos renseignements à des fournisseurs de services tiers désignés, des commanditaires de rabais de location que vous utilisez, nos entreprises sous licence et d'autres entités. Nous ne vendons pas vos renseignements à des tiers indépendants dans le but qu'ils commercialisent leurs produits ou services. Nous pouvons communiquer vos renseignements à des fins de marketing aux entités avec lesquelles nous avons conclu une entente de publicité commune, sous réserve de votre consentement. Transferts internationaux Vos renseignements peuvent être transférés en dehors de votre pays ou région de résidence, dans des pays comme les États-Unis, à des fins de traitement et de conservation. Vos renseignements peuvent être transférés en dehors de votre pays ou région de résidence à votre demande. Sécurité Nous prenons des mesures raisonnables pour protéger vos données personnelles contre le vol et l'utilisation, la divulgation ou la modification non autorisées. Nous nous efforçons de maintenir des sauvegardes physiques, électroniques et procédurales appropriées pour protéger vos données personnelles. Conservation des données En général, nous conservons les renseignements de nos clients tant que cela est nécessaire, selon nous, aux fins pour lesquelles ils ont été recueillis, ou comme la loi l'autorise. Accès, correction et portabilité Vous aurez accès aux données personnelles recueillies auprès de vous et à votre sujet pour les passer en revue ou les mettre à jour; vous pourrez ainsi modifier tout renseignement inexact. Nous ferons de notre mieux pour répondre à votre demande, mais nous nous réservons le droit d'imposer certaines restrictions et conditions. Retrait du consentement ou plaintes Lorsque le consentement est nécessaire au traitement, vous pouvez toujours retirer votre consentement. Si vous croyez que la présente politique a été violée, nous ferons de notre mieux pour apaiser vos préoccupations. Nous pouvons modifier la présente politique de confidentialité à tout moment, mais les changements ne s'appliqueront pas de façon rétroactive. Nous vous aviserons lorsque nous apporterons des changements importants en publiant une note sur les pages d'accueil de nos sites Web. Nous avons pour objectif de fournir à nos clients d'excellents services. Nous faisons des affaires dans de nombreux pays et avons pour objectif de respecter toutes les lois sur la confidentialité qui s'appliquent aux données que nous recueillons et utilisons. La présente politique est soumise au respect des lois locales. Lorsque la présente politique prévoit des normes plus élevées que les lois locales, la présente politique régit la façon dont Hertz gère vos données personnelles. En nous fournissant vos données personnelles, ou en les communiquant à nos fournisseurs de services désignés ou d'autres tiers tels que mentionnés dans la présente politique, vous consentez à ce que nous utilisions et divulguions vos données à des fins d'exploitation et aux autres fins énumérées dans la présente politique."

"accidentExcessModalText" : "AER Nueva Zelanda;
En las tarifas de Hertz en Nueva Zelanda se incluye la Exención por pérdidas y daños (LDW), que proporciona cobertura por daños por accidente al vehículo de Hertz, sujeta a ciertas exclusiones. En caso de daños por accidente cubiertos por LDW (que no sean daños por incendio, robo, conversión o intento de robo o conversión del vehículo de Hertz), se aplicará un Exceso de daños por accidente (ADE). Esta es la cantidad que contribuye a la pérdida o el daño del vehículo de alquiler.
Cuando adquiera AER, que no es un seguro, se exime de su responsabilidad por el ADE. A partir del 1 de enero del 2006, la tarifa de Reducción de los excesos por accidente (AER) es de NZD 22,00 por día, más impuesto sobre bienes y servicios (GST), (para los grupos de vehículos B, C, D, E y F), y NZD 25,00 por día, más GST (para los grupos de vehículos H, J, K, L y M)."
